- proto: BookWatched
  entities:
  - uid: 172
    components:
    - type: MetaData
      name: ritual guiding tome
    - type: Transform
      pos: -6.4689317,0.588974
      parent: 1
    - type: Paper
      content: >-
        The first step in a ritual is to draw the markings. They must be red. The rune that is in the center is in the shape of a circle, with the word "EXCHANGE" orbiting inside. Closer to the center of the rune is another circle. In the middle is a question mark in a circle.

        The second step is to draw five stars; Three above the rune, and two below it.

        Then, you must place and light candles in the center of each star.

        Place the item you wish to upgrade in the middle of the rune.

        This next step is more unorthodox than the rest. You must give a blood sacrifice to the rune. Ensure the blood reaches the middle of the rune.

        Finally, recite "Exchange and Sacrifice" from parchment.

        The item will have been enhanced however you wished it to be.

        Do not let the candles burn out during the ritual.

        Do not move the item during the ritual.

        Do not remove the blood during the ritual.
